// ALL BROWSER link rel="import" svg Polyfill 0.0.2
// Emulates the functionality of using a link tag to include the pds icon sprite
// Index files must include this fill before other js and
// the following link tag should be placed at the top of the <body>
//
//  <link class="pds-icon-src" rel="import" href="/path/to/pds-icons.svg" />
//
document.addEventListener("DOMContentLoaded", function(event) {
  var links = document.querySelectorAll('link.pds-icon-src');
  for (var i = 0; i < links.length; i++) {
    //First, we need to check to make sure the href is either not cross origin or from powerschool.com
    try {
      var linkUrl = new URL(links[i].href);
      var isCrossOrigin = linkUrl.host.toLowerCase() !== window.location.host.toLowerCase();
      var isPowerSchoolOrigin = (/\.powerschool\.com$/i).test(linkUrl.host);
      if(isCrossOrigin && !isPowerSchoolOrigin) {
        //Since the URL is cross origin and is not a .powerschool.com URL, we will skip this.
        console.error(links[i].href + ' was denied. isCrossOrigin: ' + isCrossOrigin + ' isPowerSchoolOrigin: ' + isPowerSchoolOrigin);
        continue;
      }
    } catch (e) {
      console.error('unable to parse ' + links[i].href);
      continue;
    }


    if (links[i].getAttribute('href')) {
      let filePath = links[i].getAttribute('href');
      let rawFile = new XMLHttpRequest();
      rawFile.open("GET", filePath, false);
      rawFile.onreadystatechange = function () {
        if(rawFile.readyState === 4) {
          if(rawFile.status === 200 || rawFile.status == 0) {
            console.error('Using the link tag with class pds-icon-src is no longer required by PDS and causes pds-icons.svg to be downloaded twice. The link tag should be deleted in order to prevent this.');
            //place sprite DOMstring
            var linkContent = rawFile.responseText;
            //create container
            var iconSprite = document.createElement('div');
            iconSprite.setAttribute('class', 'pds-icon-sprite');
            iconSprite.innerHTML = linkContent;
            //Insert right before original link rel element
            var insertionTarget = document.getElementsByClassName('pds-icon-src');
            var insertParent = insertionTarget[0].parentNode;
            insertParent.insertBefore(iconSprite, insertionTarget[0]);
            //insertParent.removeChild(insertionTarget[0]);
          }
        }
      };
      rawFile.send(null);
    }
  }
});

